import { connect } from 'react-redux'
import { } from '../../../redux/actions/users.js'
import { Container, Segment, Header, Divider, Grid, Input, Button } from 'semantic-ui-react'

class Deposit extends Component {
  constructor() {
    super()
    this.state={
      balance: 0
    }
  }

  componentDidMount() {

  }

  render() {
    return(
      <Container>
        <Segment>
          <Grid columns={2} relaxed='very'>
            <Grid.Column>
              <Header>Account</Header>
              <br/>
              <br/>
              <br/>
              <Input
                action={{ color: 'green', labelPosition: 'left', icon: 'plus', content: 'Amount' }}
                actionPosition='left'
                placeholder='$'
                defaultValue=''
              />
              <br/>
              <br/>
              <br/>
              <Button color='blue' style={{width:'200px'}}>Deposit</Button>
            </Grid.Column>
            <Grid.Column>
              <Header>Bank</Header>
            </Grid.Column>
          </Grid>

          <Divider vertical>Make A Deposit</Divider>
        </Segment>
      </Container>
    )
  }
}

const mapStateToProps = state => {

}

export default connect(mapStateToProps, { })(Deposit);
